  false,\n\t\"url\": null,\n\t\"notes\": \"The 1981 Caribou (Rangifer tarandus) Productivity
  and Range Investigation consisted of 5 major concentrations; winter work in February
  and March, a May calving survey, summer and fall range work, a peak-of-the-rut count
  in October, and repairs to range exclosures. This report will outline the methods
  used for each concentration, and the results obtained. Since this is an on-going
  project, this report will include only work done through October 1981.\",\n\t\"license_title\":
